// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title VotingSystem
 * @dev Hệ thống bầu cử dựa trên blockchain
 */
contract VotingSystem {
    // Cấu trúc dữ liệu
    struct Election {
        string title;
        string description;
        uint256 startTime;
        uint256 endTime;
        string logoUrl;
        bool isCompleted;
        mapping(uint256 => Candidate) candidates;
        uint256 candidateCount;
    }

    struct Candidate {
        string name;
        string description;
        string birthDate;
        string hometown;
        string position;
        string achievements;
        string motto;
        string imageUrl;
        uint256 voteCount;
        bool isElected;
    }

    struct Voter {
        string name;
        string cccd;
        string voterAddress;
        uint256 birthDate;
        bool isRegistered;
        bool hasVoted;
    }

    struct Admin {
        address adminAddress;
        string name;
        bool isActive;
    }

    struct Vote {
        uint256 electionId;
        uint256 candidateId;
        uint256 timestamp;
    }

    // Biến trạng thái
    mapping(address => Voter) public voters;
    mapping(address => bool) public isVoter;
    mapping(address => Admin) public admins;
    mapping(address => bool) public isAdmin;
    mapping(address => Vote[]) public voterHistory;
    
    Election[] public elections;
    Admin[] public adminList;
    uint256 public electionCount;
    uint256 public adminCount;

    // Events
    event ElectionCreated(uint256 electionId, string title, uint256 startTime, uint256 endTime);
    event CandidateAdded(uint256 electionId, uint256 candidateId, string name);
    event VoterRegistered(address voter, string name, string cccd);
    event Voted(address voter, uint256 electionId, uint256 candidateId);
    event AdminRegistered(address admin, string name);
    event ElectionCompleted(uint256 electionId, uint256 totalVotes);

    // Modifiers
    modifier onlyAdmin() {
        require(isAdmin[msg.sender], "Chi admin moi co the thuc hien hanh dong nay");
        _;
    }

    modifier validAge(uint256 birthDate) {
        // Kiểm tra người dùng đủ 18 tuổi (tính bằng giây)
        require(block.timestamp >= birthDate + 18 * 365 days, "Ban phai du 18 tuoi tro len");
        _;
    }

    // Các hàm cho Admin
    function addAdmin(address _adminAddress, string memory _name) public {
        // Người tạo hợp đồng hoặc admin hiện tại mới có thể thêm admin mới
        if (adminCount > 0) {
            require(isAdmin[msg.sender], "Chi admin moi co the them admin moi");
        }
        
        require(!isAdmin[_adminAddress], "Dia chi nay da la admin");
        
        admins[_adminAddress] = Admin({
            adminAddress: _adminAddress,
            name: _name,
            isActive: true
        });
        
        isAdmin[_adminAddress] = true;
        adminList.push(admins[_adminAddress]);
        adminCount++;
        
        emit AdminRegistered(_adminAddress, _name);
    }

    function removeAdmin(address _adminAddress) public onlyAdmin {
        require(isAdmin[_adminAddress], "Dia chi nay khong phai la admin");
        require(_adminAddress != msg.sender, "Ban khong the xoa chinh minh");
        
        isAdmin[_adminAddress] = false;
        admins[_adminAddress].isActive = false;
        
        // Cập nhật adminList - tìm vị trí và đánh dấu không hoạt động
        for (uint256 i = 0; i < adminList.length; i++) {
            if (adminList[i].adminAddress == _adminAddress) {
                adminList[i].isActive = false;
                break;
            }
        }
        
        adminCount--;
    }

    function getAdmin(uint256 _index) public view returns (address, string memory) {
        require(_index < adminList.length, "Chi so admin khong hop le");
        return (adminList[_index].adminAddress, adminList[_index].name);
    }

    function getAdminCount() public view returns (uint256) {
        return adminCount;
    }

    // Các hàm cho Election
    function createElection(
        string memory _title,
        string memory _description,
        uint256 _startTime,
        uint256 _endTime,
        string memory _logoUrl
    ) public onlyAdmin {
        require(_startTime > block.timestamp, "Thoi gian bat dau phai trong tuong lai");
        require(_endTime > _startTime, "Thoi gian ket thuc phai sau thoi gian bat dau");
        
        uint256 newElectionId = elections.length;
        
        Election storage newElection = elections.push();
        newElection.title = _title;
        newElection.description = _description;
        newElection.startTime = _startTime;
        newElection.endTime = _endTime;
        newElection.logoUrl = _logoUrl;
        newElection.isCompleted = false;
        newElection.candidateCount = 0;
        
        electionCount++;
        
        emit ElectionCreated(newElectionId, _title, _startTime, _endTime);
    }

    function addCandidate(
        uint256 _electionId,
        string memory _name,
        string memory _description,
        string memory _birthDate,
        string memory _hometown,
        string memory _position,
        string memory _achievements,
        string memory _motto,
        string memory _imageUrl
    ) public onlyAdmin {
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        require(block.timestamp < elections[_electionId].startTime, "Cuoc bau cu da bat dau, khong the them ung cu vien");
        
        uint256 candidateId = elections[_electionId].candidateCount;
        
        elections[_electionId].candidates[candidateId] = Candidate({
            name: _name,
            description: _description,
            birthDate: _birthDate,
            hometown: _hometown,
            position: _position,
            achievements: _achievements,
            motto: _motto,
            imageUrl: _imageUrl,
            voteCount: 0,
            isElected: false
        });
        
        elections[_electionId].candidateCount++;
        
        emit CandidateAdded(_electionId, candidateId, _name);
    }

    function getElection(uint256 _electionId) public view returns (
        string memory title,
        string memory description,
        uint256 startTime,
        uint256 endTime,
        string memory logoUrl,
        bool isCompleted,
        uint256 candidateCount
    ) {
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        
        Election storage election = elections[_electionId];
        return (
            election.title,
            election.description,
            election.startTime,
            election.endTime,
            election.logoUrl,
            election.isCompleted,
            election.candidateCount
        );
    }

    function getCandidate(uint256 _electionId, uint256 _candidateId) public view returns (
        string memory name,
        string memory description,
        string memory birthDate,
        string memory hometown,
        string memory position,
        string memory achievements,
        string memory motto,
        string memory imageUrl,
        uint256 voteCount,
        bool isElected
    ) {
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        require(_candidateId < elections[_electionId].candidateCount, "Ung cu vien khong ton tai");
        
        Candidate storage candidate = elections[_electionId].candidates[_candidateId];
        return (
            candidate.name,
            candidate.description,
            candidate.birthDate,
            candidate.hometown,
            candidate.position,
            candidate.achievements,
            candidate.motto,
            candidate.imageUrl,
            candidate.voteCount,
            candidate.isElected
        );
    }

    function getElectionCount() public view returns (uint256) {
        return elections.length;
    }

    function getCandidateCount(uint256 _electionId) public view returns (uint256) {
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        return elections[_electionId].candidateCount;
    }

    function completeElection(uint256 _electionId) public onlyAdmin {
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        require(block.timestamp > elections[_electionId].endTime, "Cuoc bau cu chua ket thuc");
        require(!elections[_electionId].isCompleted, "Cuoc bau cu da hoan thanh");
        
        uint256 maxVotes = 0;
        uint256 totalVotes = 0;
        
        // Tìm số phiếu cao nhất
        for (uint256 i = 0; i < elections[_electionId].candidateCount; i++) {
            if (elections[_electionId].candidates[i].voteCount > maxVotes) {
                maxVotes = elections[_electionId].candidates[i].voteCount;
            }
            totalVotes += elections[_electionId].candidates[i].voteCount;
        }
        
        // Đánh dấu người trúng cử
        for (uint256 i = 0; i < elections[_electionId].candidateCount; i++) {
            if (elections[_electionId].candidates[i].voteCount == maxVotes) {
                elections[_electionId].candidates[i].isElected = true;
            }
        }
        
        elections[_electionId].isCompleted = true;
        
        emit ElectionCompleted(_electionId, totalVotes);
    }

    // Các hàm cho Voter
    function registerVoter(
        string memory _name,
        string memory _cccd,
        string memory _voterAddress,
        uint256 _birthDate
    ) public validAge(_birthDate) {
        require(!isVoter[msg.sender], "Ban da dang ky roi");
        
        voters[msg.sender] = Voter({
            name: _name,
            cccd: _cccd,
            voterAddress: _voterAddress,
            birthDate: _birthDate,
            isRegistered: true,
            hasVoted: false
        });
        
        isVoter[msg.sender] = true;
        
        emit VoterRegistered(msg.sender, _name, _cccd);
    }

    function vote(uint256 _electionId, uint256 _candidateId) public {
        require(isVoter[msg.sender], "Ban chua dang ky lam cu tri");
        require(_electionId < elections.length, "Cuoc bau cu khong ton tai");
        require(_candidateId < elections[_electionId].candidateCount, "Ung cu vien khong ton tai");
        require(!hasVoted(msg.sender, _electionId), "Ban da bo phieu cho cuoc bau cu nay roi");
        require(
            block.timestamp >= elections[_electionId].startTime &&
            block.timestamp <= elections[_electionId].endTime,
            "Cuoc bau cu khong trong thoi gian dien ra"
        );
        
        // Tăng số phiếu cho ứng cử viên
        elections[_electionId].candidates[_candidateId].voteCount++;
        
        // Lưu lịch sử bỏ phiếu
        voterHistory[msg.sender].push(Vote({
            electionId: _electionId,
            candidateId: _candidateId,
            timestamp: block.timestamp
        }));
        
        emit Voted(msg.sender, _electionId, _candidateId);
    }

    function hasVoted(address _voter, uint256 _electionId) public view returns (bool) {
        for (uint256 i = 0; i < voterHistory[_voter].length; i++) {
            if (voterHistory[_voter][i].electionId == _electionId) {
                return true;
            }
        }
        return false;
    }

    function getVoter(address _voter) public view returns (
        string memory name,
        string memory cccd,
        string memory voterAddress,
        uint256 birthDate,
        bool isRegistered,
        bool hasVotedInAnyElection
    ) {
        require(isVoter[_voter], "Cu tri khong ton tai");
        
        Voter storage voter = voters[_voter];
        return (
            voter.name,
            voter.cccd,
            voter.voterAddress,
            voter.birthDate,
            voter.isRegistered,
            voter.hasVoted
        );
    }

    function getVoterHistory(address _voter) public view returns (Vote[] memory) {
        return voterHistory[_voter];
    }
}

